script: |
  super -f tsv -I q1950.sql | sort > q1950.out

vector: true

inputs:
  - name: q1950.sql
    data: |
      SELECT * FROM tab1 AS cor0 WHERE NOT - col1 IN ( - col2 * - col1, - 64 * ( ( - col0 ) ), - + col2 * 39 );
  - name: tab1

outputs:
  - name: q1950.out
    data: |
      51	14	96
      85	5	59
      91	47	68
